package web.beans;

public class Buscador {

	private String	tituloDondeEncuentra;
	private String	tipo;
	private String	url;

	public Buscador() {
		// TODO Auto-generated constructor stub
	}

	public String getTituloDondeEncuentra() {
		return tituloDondeEncuentra;
	}

	public void setTituloDondeEncuentra(String tituloDondeEncuentra) {
		this.tituloDondeEncuentra = tituloDondeEncuentra;
	}

	public String getTipo() {
		return tipo;
	}

	public void setTipo(String tipo) {
		this.tipo = tipo;
	}

	public String getUrl() {
		return url;
	}

	public void setUrl(String url) {
		this.url = url;
	}

}
